import React from 'react';

const Services = () => {
    return (
        <section>
            <h2>Наши Услуги</h2>
            <ul>
                <li>
                    <h3>Ежедневная уборка</h3>
                    <p>Поддержание чистоты в вашем офисе или доме каждый день.</p>
                </li>
                <li>
                    <h3>Генеральная уборка</h3>
                    <p>Полное очищение вашего пространства с детальным учетом каждой зоны.</p>
                </li>
                <li>
                    <h3>Уборка после ремонта</h3>
                    <p>Устранение следов строительства и ремонта, чтобы ваше помещение было готово к использованию.</p>
                </li>

            </ul>
        </section>
    );
}

export default Services;
